/*!  
 * Additional Responsive Utilities for NEYDRA Platform
 * Provides enhanced mobile/responsive functionality
 */

(function(window){
  'use strict';

  // Responsive Breakpoints
  const breakpoints = {
    xs: 0,
    sm:  576,
    md: 768,
    lg: 992,
    xl: 1200,
    xxl: 1400
  };

  // Get current breakpoint
  window.getCurrentBreakpoint = function() {
    const width = window.innerWidth;
    let current = 'xs';
    
    Object.keys(breakpoints).forEach(key => {
      if (width >= breakpoints[key]) {
        current = key;
      }
    });
    
    return current;
  };

  // Check if current breakpoint matches
  window.isBreakpoint = function(breakpoint) {
    return window.getCurrentBreakpoint() === breakpoint;
  };

  // Check if screen is mobile
  window.isMobile = function() {
    return window.innerWidth < breakpoints. md;
  };

  // Check if screen is tablet
  window.isTablet = function() {
    const width = window.innerWidth;
    return width >= breakpoints.md && width < breakpoints.lg;
  };

  // Check if screen is desktop
  window.isDesktop = function() {
    return window.innerWidth >= breakpoints. lg;
  };

  // Handle resize events
  let resizeTimer;
  window.addEventListener('resize', function() {
    clearTimeout(resizeTimer);
    resizeTimer = setTimeout(function() {
      window.dispatchEvent(new CustomEvent('breakpointChange', {
        detail: {
          breakpoint: window.getCurrentBreakpoint()
        }
      }));
    }, 250);
  });

  // Initialize on load
  document.addEventListener('DOMContentLoaded', function() {
    // Add responsive classes to body
    document.body.classList.add(`breakpoint-${window.getCurrentBreakpoint()}`);
    
    // Initialize Bootstrap components
    const dropdowns = document.querySelectorAll('[data-bs-toggle="dropdown"]');
    const modals = document.querySelectorAll('[data-bs-toggle="modal"]');
    const tabs = document.querySelectorAll('[data-bs-toggle="tab"]');
    
    dropdowns.forEach(el => {
      el.addEventListener('click', function(e) {
        e.preventDefault();
        const menu = this.nextElementSibling;
        if (menu && menu.classList.contains('dropdown-menu')) {
          menu.classList.toggle('show');
        }
      });
    });

    // Close dropdowns when clicking outside
    document. addEventListener('click', function(e) {
      const menus = document.querySelectorAll('.dropdown-menu. show');
      menus.forEach(menu => {
        if (! menu.parentElement.contains(e.target)) {
          menu.classList.remove('show');
        }
      });
    });

    // Modal handling
    modals.forEach(button => {
      button.addEventListener('click', function() {
        const modalId = this.getAttribute('data-bs-target');
        const modal = document.querySelector(modalId);
        if (modal) {
          modal.classList.add('show');
          modal.style.display = 'block';
          document.body.classList.add('modal-open');
        }
      });
    });

    // Close modals
    document.querySelectorAll('[data-bs-dismiss="modal"]').forEach(btn => {
      btn.addEventListener('click', function() {
        const modal = this.closest('.modal');
        if (modal) {
          modal.classList. remove('show');
          modal.style.display = 'none';
          document.body.classList.remove('modal-open');
        }
      });
    });

    // Tab handling
    tabs.forEach(tab => {
      tab.addEventListener('click', function(e) {
        e.preventDefault();
        const targetId = this.getAttribute('data-bs-target');
        const target = document. querySelector(targetId);
        
        // Remove active from all tabs and contents
        this.parentElement.querySelectorAll('[data-bs-toggle="tab"]').forEach(t => {
          t.classList.remove('active');
        });
        document.querySelectorAll('. tab-pane').forEach(pane => {
          pane.classList.remove('active', 'show');
        });
        
        // Add active to current tab and content
        this.classList.add('active');
        if (target) {
          target. classList.add('active', 'show');
        }
      });
    });
  });

  // Utility:  Show/hide elements based on breakpoint
  window.showOnBreakpoint = function(element, breakpoints) {
    function checkBreakpoint() {
      const current = window.getCurrentBreakpoint();
      if (breakpoints. includes(current)) {
        element.style.display = '';
      } else {
        element.style.display = 'none';
      }
    }
    
    checkBreakpoint();
    window.addEventListener('breakpointChange', checkBreakpoint);
  };

  // Utility:  Collapse navigation on mobile
  window.makeResponsiveNav = function(navSelector) {
    const nav = document. querySelector(navSelector);
    if (!nav) return;
    
    const toggle = document.createElement('button');
    toggle.className = 'navbar-toggler';
    toggle.innerHTML = '<span class="navbar-toggler-icon"></span>';
    
    toggle.addEventListener('click', function() {
      nav.classList. toggle('show');
    });
    
    nav.parentElement.insertBefore(toggle, nav);
  };

})(window);